import {Redirect, useHistory} from "react-router-dom";

export interface Props{
	
}

type State = {
	
}

export class Autorize extends Component<Props, State>{

	routeChange=()=> {
		let path = `/fetch-data`;
		let history = useHistory();
		history.push(path);
	}
	
	
	render() {
		return (
			<div>
				<h1>Авторизация</h1>
				<div>
					<b>Логин</b><input type="text"/>
				</div>
				<div>
					<b>Пароль</b><input type="text"/>
				</div>
				<div>
					<button onClick={()=> this.routeChange()} className="btn btn-success">Авторизация</button>
				</div>
			</div>
		);
	}
}
